					attribute_code: "description",
					value:
						"<ul>\r\n<li>Connect standard USB Type-A enabled devices and peripherals (flash drives, keyboards, mice and more) to USB Type-C enabled devices </li>\r\n<li>Female adapter ensures easy connections and reliable performance, supporting data transfer up to 5 Gbps</li>\r\n<li>Reversible design - easily insert the connector into any Type-C enabled device (does not matter which side is up)</li>\r\n<li>Type-C port is half the width and one-third the height of a standard USB-A connector (slightly larger compared to Lightning or Micro-USB ports)</li>\r\n<li>Certified by USB-IF to be compliant with USB 3.1 Gen 1 Standard; backwards compatibility to USB 3.0 and 2.0; power output up to 5V, 3 Amp</li>\r\n<li>Measures approximately 1 miter</li>\r\n<li>1/2 year limited warranty</li>\r\n<li>For customer service and warranty related queries please contact_us through Chat anytime availabe</li>\r\n</ul>",
